import styled from 'styled-components'

const StyledIcon = styled.svg`
    display: inline;
    width: 30px;
    color: gold;
    margin-right: 10px;
`

export const ChevronStyledIcon = styled.svg`
    width: 18px;
    margin-left: auto;
    margin-right: 12px;
`

export default StyledIcon
